How to push an item to array field of model in Mongoose<p>I have 2 collections like this:</p>

<pre class="lang-js prettyprint-override"><code>const vocaSchema = {
    word: String,
    type: String,
    meaning: String,
    sente: String,
    semean: String,
    sug: String
};

const Voca = mongoose.model('Voca', vocaSchema);

const setVocaSchema = {
    lessonId: String,
    vocaList: [vocaSchema]
};

const SetVoca = mongoose.model('SetVoca', setVocaSchema);
</code></pre>

<p>and now I want to push a new <code>Voca</code> to <code>vocaList</code> field, and this is my code:</p>

<pre class="lang-js prettyprint-override"><code>app.post('/lesson/add-voca/:lessonID', (req, res) =&gt; {
    const lessonID = req.params.lessonID;

    const newVoca = new Voca({
        word: req.body.addWord,
        type: req.body.addType,
        meaning: req.body.addMeaning,
        sente: req.body.addStc,
        semean: req.body.addStcm,
        sug: req.body.addSggt
    });

    console.log(newVoca);

    SetVoca.findOneAndUpdate({ lessonId: lessonID }, { $push: { vocaList: newVoca } }, (err, result) =&gt; {
        if (!err) {
            console.log(result);
            res.redirect('/lesson/add-voca/' + lessonID);
        } else {
            console.log(result);
            res.render('error');
        }
    });
});
</code></pre>

<p>and the result is <code>undefined</code> :(
<a href="https://i.stack.imgur.com/iX17C.jpg" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/iX17C.jpg" alt="enter image description here"></a> 
<br>I don't know how to fix it. Anyone, please help me, thank you so much!</p>

