<p><strong>Documents:</strong></p>

<pre><code>[
 {
  _id: "5b7579f2deea1c6e46fd9739",
  name: "Sales",
  companyId: "123",
 },
 {
   _id: "5c5779f1dffe1c6e45df3973",
