<p><strong>Actual Result:</strong></p>

<pre><code>[
 {
  _id: "5b7579f2deea1c6e46fd9739",
  name: "Sales",
  companyId: "123",
 },
]
</code></pre>

<p><strong>Aggregate Query:</strong></p>

<pre><code>db.getCollection('departments').aggregate([
  {
    $sort:{ item: 1 }
  },
  {
    $group: {
        _id:'$item',
      companyId: { $first:'$companyId'},
      name: { $first:'$name'},
    }
  }
])
</code></pre>

