Unexpected behavior for transactions using mongo-go-driver with Azure Cosmos DB<p>I'm sure I'm missing something, but I couldn't get the following simple transaction to work as expected. This behavior is different to all other SO questions I could find.  </p>

<p>The following function <code>MultipleInsertsTransaction()</code> is inspired by the <a href="https://github.com/mongodb/mongo-go-driver/blob/master/examples/documentation_examples/examples.go" rel="nofollow noreferrer">official examples</a>.<br>
It writes one document successfully and then attempts to write a second document, which returns an error, because the same ID is used again (intentionally).</p>

<p>My understanding is, that none of these documents are persisted in the database, as we never reached <code>sc.CommitTransaction(sc)</code>, so all operations within <code>StartTransaction()</code> and <code>AbortTransaction()</code> should be rolled back or rather not even visible to other sessions.</p>

<p>However, that's not the case. The first document is written, the second throws an error as expected, but after the function returned, the first document is persisted in the database.</p>

<p><strong>What is wrong with this transaction? what am I missing? Or is this even expected?</strong></p>

<pre class="lang-golang prettyprint-override"><code>package main

import (
    "context"
    "fmt"
    "go.mongodb.org/mongo-driver/bson"
    "go.mongodb.org/mongo-driver/bson/primitive"
    "go.mongodb.org/mongo-driver/mongo"
    "go.mongodb.org/mongo-driver/mongo/options"
    "go.mongodb.org/mongo-driver/mongo/readconcern"
    "go.mongodb.org/mongo-driver/mongo/writeconcern"
)

const (
    db = "test"
    coll = "test"
)

func main() {
    client, _ := mongo.Connect(context.Background(), options.Client().ApplyURI("&lt;put replica set connection string here&gt;"))
    want, _ := client.Database(db).Collection(coll).CountDocuments(context.Background(), bson.M{})
    if err := MultipleInsertsTransaction(context.Background(), client); err != nil {
        fmt.Println("expected error occured...")
    }
    got, _ := client.Database(db).Collection(coll).CountDocuments(context.Background(), bson.M{})
    if got != want {
        fmt.Printf("expected %d entries in database, but got %d", want, got)
        return
    }
    fmt.Println("it worked!!")
}

func MultipleInsertsTransaction(ctx context.Context, client *mongo.Client) (err error) {
    return client.UseSession(ctx, func(sc mongo.SessionContext) error {
        err := sc.StartTransaction(options.Transaction().
            SetReadConcern(readconcern.Snapshot()).
            SetWriteConcern(writeconcern.New(writeconcern.WMajority())),
        )
        if err != nil {
            return err
        }

        id := primitive.NewObjectID()

        if _, err := client.Database(db).Collection(coll).InsertOne(sc, bson.M{"_id": id}); err != nil {
            sc.AbortTransaction(sc)
            return err
        }

        if _, err := client.Database(db).Collection(coll).InsertOne(sc, bson.M{"_id": id}); err != nil {
            sc.AbortTransaction(sc)
            return err
        }

        return sc.CommitTransaction(sc)
    })
}

</code></pre>

