    if(process.env.STORAGE_TYPE == 's3') {
        return s3.
            deleteObject({
                Bucket: 'upload-example-nodeapp',
                Key: this.key
            })
            .promise()
    } else {
        return promissify(fs.unlink)(
            path.resolve(__dirname, '..', '..', 'tmp', 'uploads', this.key)
        );
    }
});

</code></pre>

